import React from 'react';
import {
  Sidebar,
  Menu,
  MenuItem,
  SubMenu,
  useProSidebar,
  ProSidebarProvider
} from 'react-pro-sidebar';
import 'tailwindcss/tailwind.css'; // Import Tailwind CSS

const user = {
  id: 1,
  name: 'John Doe',
  walletBalance: 1000,
  interestEarned: 50,
};

const SidebarContent = () => {
  return (
    <Sidebar>
      <Menu>
        <MenuItem>Dashboard</MenuItem>
        <SubMenu label="Components">
          <MenuItem>Component 1</MenuItem>
          <MenuItem>Component 2</MenuItem>
        </SubMenu>
        <SubMenu label="User Profile">
          <MenuItem>
            <div className="p-4">
              <h2 className="text-lg font-bold">{user.name}</h2>
              <div className="mt-2">
                <p className="text-sm">Wallet Balance: ${user.walletBalance}</p>
                <p className="text-sm">Interest Earned: ${user.interestEarned}</p>
              </div>
            </div>
          </MenuItem>
        </SubMenu>
        <MenuItem>Settings</MenuItem>
      </Menu>
    </Sidebar>
  );
};

const SidebarWrapper = () => {
  return (
    <ProSidebarProvider>
      <SidebarContent />
    </ProSidebarProvider>
  );
};

export default SidebarWrapper;
